	id: string;
	category: string;
	content: string;
	tags: Array<string>;
}

const ProjectContainer: React.VFC = () => {
	const cardData = useSelector((state: RootReducerType) => state.cardReducer);
	console.log(cardData.projectCards);

	return <ProjectsPresenter />;
};

